import { Component } from '@angular/core';

@Component({
  selector: 'login-component',
  templateUrl: './login.component.html'
})
export class LoginComponent {

}

<style>
  .centered-text {
    text-align: center;
  }
</style>
<h1 class="text-white centered-text">Login</h1>
<br>
<div style="text-align: center;  margin-bottom: 30px;">
  <label style="color: white; font-weight: normal; font-size: 20px; margin-bottom: 20px; display: inline-block; width: 100px;">UserName:</label>
  <input type="text" style="border: 1px solid #A3A3A3; background-color: #A3A3A3; height: 45px; border-radius: 20px; font-size: 18px; padding: 10px; width: 350px; display: inline-block;" name="UserName" required placeholder="UserName">
</div>

<div style="text-align: center;  margin-bottom: 30px;">
  <label style="color: white; font-weight: normal; font-size: 20px; margin-bottom: 20px; display: inline-block; width: 100px;">Password:</label>
  <input type="text" style="border: 1px solid #ccc; background-color: #A3A3A3; height: 45px; border-radius: 20px; font-size: 18px; padding: 10px; width: 350px; display: inline-block;" name="Password" required placeholder="Password">
</div>
<div style="text-align: center; margin-bottom: 40px;">
  <p>Create An account? <a href=""> Sign Up</a></p>
  <input type="submit" value="Login" id="Login" name="Login" style="background-color: #A92222; color: white; text-align: center; border-radius: 10px; margin-bottom: 20px; padding: 10px 20px; border: none; width: 100px;">
</div>
